this has been the backdrop of the poems on gender based violence that i have been writing and sharing in the past 10 days. i and thousands of other people out there, have given our voice to this cause through poetry and other form. you too can be a part of it. together, let's tell our stories
.
@regran_ed from @unwomen -  from poetry to books, we can use our words to tell the world #hearmetoo. we need to end violence against women and girls! make yours at unwomen.org/mystory - #regrann #ewnaija #ellawritesnaija #ellawritesng #16daysofactivism #orangetheworld #metoo #timesup #endviolenceagainstchildren #endvaw #endgbv

